(()=>{var e=document.querySelector(".input_text"),t=document.querySelector("#name"),n=document.querySelector(".temp"),a=document.querySelector(".desc");document.querySelector(".clouds"),document.querySelector(".submit").addEventListener("click",(function(r){fetch("https://api.openweathermap.org/data/2.5/weather?q="+e.value+"&appid=50a7aa80fa492fa92e874d23ad061374").then((e=>e.json())).then((r=>{var c=r.main.temp,o=r.name,u=r.weather[0].description;t.innerHTML=o,a.innerHTML="Desc - "+u,n.innerHTML="Temp - "+c,e.value=""})).catch((e=>alert("Wrong city name!")))}))})();